import React from "react";
import './explore.css';

const Aboutus_service = () =>{
    return(
          <div className="service_bf" style={{background:"#1f1f1f",minHeight:"428px"}}>
          <div className="container">
            <center>
            <span style={{fontWeight:"300" }} className="service_title" >Explore our <span style={{fontWeight:"800"}}>Services</span></span>
            </center>
          </div>
          </div>
    )
}
export default Aboutus_service;
